import React, { Component, Fragment } from 'react'


export default class OneMovie extends Component {

    state = {movie: {}};

    componentDidMount() {
        this.setState({movie: {
            id: this.props.match.params.id,
            title: "Some movie",
            runtime: 150,
        }})
    }




    render() {
        return (
            <Fragment>
                <h2>Movie: {this.state.movie.title}</h2>

            </Fragment>
        )
    }

}
